import React from "react";
import styled from "styled-components";
import coconutfiber from "../images/CoconutFiber.webp";

const ProductStyled = styled.div`
  padding: 2rem 3rem;
  background-color: #9c9c9c;
  h1 {
    font-size: 3.1785rem;
    color: #fff;
  }
`;

const Products = () => {
  return (
    <ProductStyled>
      <h1>Products</h1>
    </ProductStyled>
  );
};

export default Products;
